  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of classified LiDAR
  (Light Detection and Ranging) elevation points produced by the PAMAP Program. Additional
  information is available at the PAMAP website: www.dcnr.state.pa.us/topogeo/pamap.
  PAMAP data are organized into blocks, which do not have gaps or overlaps, that represent
  10,000 feet by 10,000 feet on the ground. The coordinate system for blocks in the
  northern half of the state is Pennsylvania State Plane North (datum:NAD83, units:
  feet); blocks in the southern half of the state are in Pennsylvania State Plane
  South. A block name is formed by concatenating the first four digits of the State
  Plane northing and easting defining the block's northwest corner, the State identifier
  \"PA\", and the State Plane zone designator \"N\" or \"S\" (e.g. 45001210PAS). The
  following are the collection dates for each county chronologically from 2006-2008:
  Chester : 20060321 - 20060502 ---- Cumberland : 20060406 - 20060429 ---- Dauphin
  : 20060406 - 20060429 & 20060321 - 20060502 ---- Delaware : 20060406 - 20060429
  ---- Fayette : 20060406 - 20060429 & 20070430 ---- Franklin : 20060406 - 20060429
  & 20060321 - 20060502 ---- Fulton : 20060406 - 20060429 ---- Greene : 20060406 -
  20060429 ---- Huntingdon : 20060406 - 20060429 ---- Indiana : 20060406 - 20060429
  ---- Juniata : 20060426 - 20060430 ---- Lancaster : 20060426 - 20060430 ---- Lawrence
  : 20060426 - 20060430 & 20060406 - 20060429 & 20060321 - 20060502 ---- Adams : 20070430
  ---- Allegheny : 20070430 ---- Armstrong : 20070430 ---- Beaver : 20070430 ----
  Bedford : 20070430 ---- Berks : 20070430 ---- Blair : 20070430 ---- Bucks : 20070430
  ---- Butler : 20070430 ---- Cambria : 20070430 ---- Lebanon : 20080330 - 20080418
  & 20080419 - 20080420 ---- Lehigh : 20080330 - 20080418 & 20080419 - 20080420 &
  20080415 - 20080419 & 20080423 - 20080424 ---- Mifflin : 20080410 - 20080411 & 20080330
  - 20080418 & 20080410 - 20080419 ---- Montgomery : 20080410 - 20080411 & 20080425
  ---- Northampton : 20080410 - 20080418 & 20080402 - 20080403 & 20080321 - 20080326
  ---- Perry : 20080410 - 20080419 & 20080410 - 20080418 & 20080424 & 20080415 - 20080419
